  @override
  String get termOfUseText => 'Հրաժարում պատասխանատվությունից\nԿիրառելի օրենքով թույլատրված առավելագույն չափով մենք բացառում ենք մեր կայքի և այս կայքի օգտագործման հետ կապված բոլոր ներկայացուցչությունները, երաշխիքները և\nպայմանները: Այս հերքումից ոչինչ չի սահմանափակի կամ կբացառի մեր կամ ձեր պատասխանատվությունը մահվան կամ անձնականի համար: վնասվածք;\nսահմանափակել կամ բացառել մեր կամ ձեր պատասխանատվությունը խարդախության կամ խարդախ խեղաթյուրման համար;\nսահմանափակել մեր կամ ձեր պարտավորություններից որևէ մեկը, որը չի թույլատրվում կիրառելի օրենքով, կամ\nբացառել մեր կամ ձեր պարտավորություններից որևէ մեկը, որը չի կարող բացառվել համաձայն կիրառելի օրենսդրությունը:\nՊատասխանատվության սահմանափակումներն ու արգելքները, որոնք սահմանված են այս բաժնում և սույն պատասխանատվության այլ կետերում. Հանցագործության և օրենքով սահմանված պարտականությունների խախտման համար:\n\nՔանի դեռ կայքը և վեբկայքի տեղեկատվությունը և ծառայությունները տրամադրվում են անվճար, մենք պատասխանատվություն չենք կրի որևէ բնույթի կորստի կամ վնասի համար: .\n\nՎճարովի բեռնաթափման ծառայություններից օգտվելու պայմաններ\nՈրպես ApagaCommunity համայնքի մաս, դուք կարող եք բաժանորդագրվել որպես անհատ կամ\nկազմակերպություն, ձեր տանից, բիզնեսից, շենքից կամ գրասենյակից կանոնավոր վերամշակվող թափոնների հավաքման համար\n\nԲաժանորդագրվելով այս ծառայությանը՝ դուք հաստատում եք, որ կհամապատասխանեք հետևյալ կետերին. վերցնելու, վերցնելու օրվա ամբողջ գումարը վճարելու համար,\nԿենցաղային բաժանորդագրության դեպքում ներկայացնել մինչև 200լ պլաստիկ թափոն, 100լ թղթի թափոն և կամ 50լ ապակու թափոն յուրաքանչյուր հավաքագրման համար՝ ըստ ձեր բաժանորդագրության տեսակի: \nԿազմակերպչական բաժանորդագրության դեպքում ներկայացնել մինչև 600լ պլաստիկ թափոններ, 300լ թղթի թափոններ և կամ 100լ\nապակու թափոններ՝ ըստ ձեր բաժանորդագրության տեսակի: .\nՊլաստիկը ՉԻ պարունակի սննդի մնացորդի ցանկացած հետք\nՊլաստիկ CAN-ը դեռևս ունի պիտակներ և կափարիչներ\nՀայաստանում պլաստիկի հետևյալ տեսակները ՉԵՆ վերամշակվում՝ PVC, PS փրփուր։\nԹուղթը չպետք է լինի յուղոտ բծերից կամ սննդի մնացորդներից։\nԹուղթը չպետք է կազմված լինի կամ լամինացված այլ տեսակի նյութերով, ինչպիսիք են պլաստմասսա և կամ մետաղներ\nԱպակիները չպետք է կոտրվեն\nԱպակիները չպետք է լինեն որևէ էլեկտրոնային սարքավորման կամ մեքենայի մասերի մաս\nԱմբողջ թափոնները պետք է փաթեթավորվեն տոպրակների մեջ, նախքան վարորդի գտնվելու վայրը հասնելը\nՊարկերը չեն տրամադրված է «Ապագահամայնք» ՓԲԸ-ի կողմից\nՕրինակ հաճախորդների հետ երբեմն դժվարությունների պատճառով, խնդրում ենք համոզվեք, որ ձեզ հասանելի են հեռախոսով\nձեր վերցնելու օրը, եթե այլ բան հատուկ հանձնարարված չէ:\nԵթե ձեզ հասանելի չեն հեռախոսով, և չկան հատուկ հրահանգներ որտեղից վերցնել ձեր\nաղբը, վարորդը չի մոտենա, և ձեր պիկապը համարվում է կորած։\nՀնարավոր է պատվիրել ժամանակացույցից դուրս՝ հրաժարվելով ձեր պայմանագրային պիկապներից մեկը կամ վճարելով\nավելին։ Խնդրում ենք կապնվել մեզ հետ գնանշման համար:\nSmartApaga Recycling Containers Network-ի օգտագործման պայմանները\nՈրպես ApagaCommunity-ի համայնքի մաս, դուք կարող եք մուտք գործել մեր SmartApaga\nՎերամշակման բեռնարկղերի ցանց՝ որպես անհատ կամ կազմակերպություն:\n\nԲաժանորդագրվելով այս ծառայությանը , դուք հաստատում եք, որ կհամապատասխանեք հետևյալ կետերին.\nԴուք կվերացնեք միայն մաքուր և վերամշակվող պլաստիկը.\nՊլաստիկը չպետք է պարունակի սննդի մնացորդի հետքեր\nՊլաստիկը կարող է դեռևս ունենալ պիտակներ և գլխարկներ\nՊլաստիկի հետևյալ տեսակները չեն վերամշակվում։ Հայաստանում՝ PVC, PS փրփուր։\nԴուք չափից դուրս չեք լցնի տարաները\nԴուք չեք փորձի խաբել՝ այլ ավելի ծանր նյութեր ներկայացնելով տարաների մեջ\nլրացուցիչ ApagaCoin պարգևներ ստանալու նպատակով։\nԴուք չեք փորձի վնասել տարաները։ բեռնարկղեր\nԴուք մեզ կտեղեկացնեք, եթե ականատես լինեք տարաները վնասելու որևէ փորձի';

  @override
  String get privacyPolicyText => 'SmartApaga > Գաղտնիության քաղաքականություն SmartApaga LLC-ն ստեղծել է SmartApaga հավելվածը որպես անվճար հավելված:\nԱյս ԾԱՌԱՅՈՒԹՅՈՒՆԸ տրամադրվում է SmartApaga ՍՊԸ-ի կողմից անվճար և նախատեսված է օգտագործելու համար, ինչպես կա:\n\nԱյս էջն օգտագործվում է այցելուներին տեղեկացնելու մեր քաղաքականության վերաբերյալ: հավաքում, օգտագործում և բացահայտում\nԱնձնական տեղեկություններ, եթե որևէ մեկը որոշել է օգտվել մեր Ծառայությունից:\n\nԵթե դուք ընտրում եք օգտվել մեր Ծառայությունից, ապա դուք համաձայնում եք\nայս քաղաքականության վերաբերյալ տեղեկատվության հավաքագրմանը և օգտագործմանը: Անձնական տվյալները, որոնք մեր հավաքագրումն օգտագործվում է Ծառայությունը տրամադրելու և բարելավելու համար:\nՄենք չենք օգտագործի կամ կիսվի ձեր տեղեկությունները որևէ մեկի հետ, բացառությամբ սույն Գաղտնիության քաղաքականության մեջ նկարագրվածի:\n\nԱյս Գաղտնիության քաղաքականության մեջ օգտագործվող տերմիններն ունեն նույն նշանակությունը, ինչ մեր Պայմաններում և դրույթներում: ,\nորը հասանելի է SmartApaga-ում, եթե այլ բան սահմանված չէ սույն Գաղտնիության քաղաքականության մեջ:\n\nՏեղեկությունների հավաքագրում և օգտագործում\n\nՄեր Ծառայությունից օգտվելու ընթացքում ավելի լավ փորձի համար մենք կարող ենք պահանջել, որ մեզ տրամադրեք որոշակի\nանձնական նույնականացման տվյալներ, i. ներառյալ, բայց չսահմանափակվելով լրիվ անվանումով, հեռախոսահամարով, էլ. փոստով,\nհասցեով: Մեր պահանջած տեղեկությունները կպահվեն մեր կողմից և կօգտագործվեն այնպես, ինչպես նկարագրված է այս գաղտնիության քաղաքականության մեջ:\nՀավելվածն օգտագործում է երրորդ կողմի ծառայություններ, որոնք կարող են հավաքել ձեր նույնականացման համար օգտագործվող տեղեկությունները:\n\nՀղում երրորդ կողմի ծառայություններ մատուցողների գաղտնիության քաղաքականությանը, որոնք օգտագործվում են հավելվածը\n\nGoogle Play ծառայությունների գրանցամատյանների տվյալները\n\nՑանկանում ենք տեղեկացնել ձեզ, որ երբ օգտվում եք մեր Ծառայությունից, հավելվածում սխալի դեպքում մենք հավաքում ենք\nտվյալներ և տեղեկություններ (երրորդ կողմի արտադրանքի միջոցով) ձեր հեռախոսից Մատյան տվյալներ. Այս մատյան տվյալները կարող են\nներառել այնպիսի տեղեկություններ, ինչպիսիք են՝ ձեր սարքի Ինտերնետ արձանագրության («IP») հասցեն, սարքի անունը, օպերացիոն\nհամակարգի տարբերակը, հավելվածի կազմաձևումը մեր Ծառայությունն օգտագործելիս, Ծառայությունից ձեր օգտագործման ժամանակը և ամսաթիվը և այլ վիճակագրություն։\n\nԹխուկներ\n\nՔուքիները փոքր քանակությամբ տվյալների պարունակող ֆայլեր են, որոնք սովորաբար օգտագործվում են որպես անանուն եզակի\nիդենտիֆիկատորներ։ Դրանք ուղարկվում են ձեր դիտարկիչին այն կայքերից, որոնք դուք այցելում եք և պահվում են ձեր սարքի ներքին հիշողության մեջ:\n\nԱյս Ծառայությունը բացահայտորեն չի օգտագործում այդ «քուքիները»: Այնուամենայնիվ, հավելվածը կարող է օգտագործել երրորդ կողմի կոդը և գրադարանները, որոնք օգտագործում են «քուքիներ»՝ տեղեկատվություն հավաքելու և իրենց ծառայությունները բարելավելու համար: Դուք կարող եք\nչընդունել կամ չմերժել այս քուքիները և իմանալ, թե երբ է քուքի ուղարկվում ձեր սարքին: Եթե ​​\nընտրեք մերժել մեր թխուկները, հնարավոր է, որ չկարողանաք օգտագործել այս Ծառայության որոշ հատվածներ:\n\nԾառայությունների մատակարարներ\n\nՄենք կարող ենք աշխատանքի ընդունել երրորդ կողմի ընկերություններ և անհատներ հետևյալ պատճառներով.\n\nԴյուրացնելու համար մեր ծառայությունը; Ծառայությունը մեր անունից տրամադրելու համար. Ծառայությունների հետ կապված ծառայություններ իրականացնելու համար; կամ\nՄեզ օգնելու համար վերլուծել, թե ինչպես է օգտագործվում մեր Ծառայությունը: Մենք ցանկանում ենք տեղեկացնել այս Ծառայության օգտատերերին, որ այս\nերրորդ կողմերը հասանելի են ձեր Անձնական տեղեկատվությանը: Պատճառը մեր անունից իրենց հանձնարարված առաջադրանքները\nկատարելն է։ Այնուամենայնիվ, նրանք պարտավոր են չհրապարակել կամ օգտագործել տեղեկատվությունը որևէ այլ նպատակի համար:\n\nԱնվտանգություն\n\nՄենք գնահատում ենք ձեր վստահությունը մեզ ձեր անձնական տեղեկությունները տրամադրելու հարցում, հետևաբար մենք ձգտում ենք օգտագործել դրանք պաշտպանելու առևտրային\nընդունելի միջոցներ: Բայց հիշեք, որ ինտերնետի միջոցով փոխանցման ոչ մի եղանակ,\nէլեկտրոնային պահպանման եղանակը 100% անվտանգ և հուսալի չէ, և մենք չենք կարող երաշխավորել դրա բացարձակ անվտանգությունը:\n\nՀղումներ դեպի այլ կայքեր\n\nԱյս ծառայությունը կարող է պարունակել այլ կայքերի հղումներ . Եթե ​​սեղմեք երրորդ կողմի հղման վրա, դուք կուղղորդվեք այդ\nկայք: Նկատի ունեցեք, որ այս արտաքին կայքերը չեն շահագործվում մեր կողմից: Հետևաբար, մենք խստորեն խորհուրդ ենք տալիս վերանայել\nայս վեբկայքերի Գաղտնիության քաղաքականությունը։\nՄենք չենք վերահսկում և պատասխանատվություն չենք կրում երրորդ կողմի կայքերի կամ ծառայությունների բովանդակության, գաղտնիության քաղաքականության կամ գործելակերպի համար։\n\nԵրեխաների գաղտնիությունը\n n\nԱյս Ծառայությունները չեն վերաբերում 13 տարեկանից ցածր որևէ մեկին: Մենք գիտակցաբար չենք հավաքում 13 տարեկանից փոքր երեխաներին անձը հաստատող տեղեկություններ: Եթե ​​հայտնաբերենք, որ մինչև 13 տարեկան երեխան մեզ անձնական տվյալներ է տրամադրել, մենք անմիջապես ջնջում ենք դրանք մեր սերվերներից: Եթե ​​դուք \nծնող կամ խնամակալ եք և տեղյակ եք, որ ձեր երեխան մեզ անձնական տվյալներ է տրամադրել,\nխնդրում ենք կապվել մեզ հետ, որպեսզի մենք կարողանանք անել անհրաժեշտ գործողությունները:\n\nՓոփոխություններ այս Գաղտնիության քաղաքականության մեջ\n\nՄենք կարող ենք ժամանակ առ ժամանակ թարմացրեք մեր Գաղտնիության քաղաքականությունը: Այսպիսով, ձեզ խորհուրդ է տրվում\nպարբերաբար վերանայել այս էջը ցանկացած փոփոխության համար: Մենք ձեզ կտեղեկացնենք ցանկացած փոփոխության մասին՝ փակցնելով նոր Գաղտնիության քաղաքականությունը\nայս էջում:\n\nԿապվեք մեզ հետ\n\nԵթե ունեք հարցեր կամ առաջարկներ մեր Գաղտնիության քաղաքականության վերաբերյալ, մի հապաղեք կապվել մեզ հետ\ninfo@smartapaga.com';

